import './AmbulanceRegisForm.css'
import { useState } from "react";

//let AmbulanceRegisForm =()=>
//HB
export default function AmbulanceRegisForm() {
    // for loginAll table
    const [uname, setUname] = useState("");
    const [password, setPassword] = useState("");
    const [role, setRole] = useState("Ambulance");

    const [drivername, setDname] = useState("");
    const [aregno, setAregno] = useState("");
    const [avehicalno, setVehicalno] = useState("");
    const [email, setEmail] = useState("");
    const [mono, setMono] = useState();
    const [website, setWebsite] = useState("");
    const [state, setState] = useState("");
    const [city, setCity] = useState("");
    const [pincode, setPincode] = useState();
    const [landmark, setLandmark] = useState("");
    // const[availablestatus,setAvailablestatus]= useState();   guid by maam
    const [ac_status, setAcStatus] = useState(1);

    //when click on butoon this fun get called
    const hancelClick = (e) => {
        e.preventDefault()
        const ambulanceregistraion = {
            uname, password, role, drivername, aregno, avehicalno, email, mono, website,
            state, city, pincode, landmark, ac_status
        }      //availablestatus removed from it
        console.log(ambulanceregistraion);

        fetch("http://localhost:8080/ambulancesignup",
            {
                method: "POST",
                headers: { "Content-type": "application/json" },
                body: JSON.stringify(ambulanceregistraion)
            }).then(() => { console.log("Ambulance registerd Sucessfully ") })
    }
    //
    //clear button finction
    const clearFilds = () => {
        setUname("")
        setPassword("")

        setDname("")
        setAregno("");
        setVehicalno("");
        setEmail("")
        setMono("")
        setWebsite("")
        setState("")
        setCity("")
        setPincode("")
        setLandmark("")
        // setAvailablestatus()
    }


    //fetch data again back


    //return method will return html to browser
    return (

        <div>
            <form className="formInput container mt-5">
                <div className="signup-form">
                    <h3 className="form-title">Ambulance Register Form</h3>

                    <div className="form-group">
                        <label >Enter Username</label>
                        <input type="text" className="form-control" name="uname"
                            onChange={(e) => setUname(e.target.value)}
                        />
                    </div>

                    <div className="form-group">

                        <label >Enter Password</label>
                        <input type="password" className="form-control" name="password"
                            onChange={(e) => setPassword(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter Driver Name</label>
                        <input type="text" className="form-control" name="drivername"
                            onChange={(e) => setDname(e.target.value)}
                        />

                    </div>
                    <div className="form-group">

                        <label >Enter Ambulance Registration Number</label>
                        <input type="text" className="form-control" name="aregno"
                            onChange={(e) => setAregno(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter Ambulance (Vehical) Number</label>
                        <input type="text" className="form-control" name="avehicalno"
                            onChange={(e) => setVehicalno(e.target.value)}
                        />
                    </div>

                    <div className="form-group">

                        <label >Enter Your Email</label>
                        <input type="email" className="form-control" name="email"
                            onChange={(e) => setEmail(e.target.value)}
                        />

                    </div>
                    <div className="form-group">


                        <label >Enter Your Mobile Number</label>
                        <input type="number" className="form-control" name="mono"
                            onChange={(e) => setMono(e.target.value)}
                        />
                    </div>
                    <div className="form-group">

                        <label >Enter Your Website (If having)</label>
                        <input type="text" className="form-control" name="website"
                            onChange={(e) => setWebsite(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter State</label>
                        <input type="text" className="form-control" name="state"
                            onChange={(e) => setState(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter City</label>
                        <input type="text" className="form-control" name="city"
                            onChange={(e) => setCity(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter Pincode</label>
                        <input type="number" className="form-control" name="pincode"
                            onChange={(e) => setPincode(e.target.value)}
                        />

                    </div>

                    <div className="form-group">
                        <label >Enter landmark</label>
                        <input type="text" className="form-control" name="landmark"
                            onChange={(e) => setLandmark(e.target.value)}
                        />

                    </div>

                    {/* available or not status set automatic (guid by maam) */}
                    {/* <label>Are You Available To Work</label>
<div className="form-check">

                <input type="radio" className="form-check-input" value="1" id="yes"
                // onChange={(e)=>{dispatch({type:'update',field:'gender',val:e.target.value})}} name="gender" />
                onChange={(e)=> setAvailablestatus(e.target.value) } />
                <label className="form-check-label" htmlFor="yes">Yes</label>
</div>

<div className="form-check">
                <input type="radio" className="form-check-input" value="0" id="no"
                // onChange={(e)=>{dispatch({type:'update',field:'gender',val:e.target.value})}} name="gender" />
                onChange={(e)=> setAvailablestatus(e.target.value) } />
                <label className="form-check-label" htmlFor="no">NO</label>
                <br/>
</div> */}

                    <div className="form-group">
                        <button className="btn btn-primary btn-blob" onClick={hancelClick} >Submit/Register</button>
                        <button className="btn btn-primary btn-blob" onClick={clearFilds} >Clear</button>
                    </div>

                </div>

            </form>

        </div>

    );


}
// export default AmbulanceRegisForm;
